import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


let cursos = ['Codecademy','Udemy','LinuxAcademu','SafariBooks','AWS','Politecnica','Edex','Amazon']

const Card = ({curso}) => {
    return(
        <div className='card'>
            <img className='imgCard'></img>
            <div className='infoCard'>{curso}</div>
        </div>
    );
}

const ListCard = (props) => {

    let listado = cursos.map((element) => <Card curso={element}></Card>);

    return (<section className='groupCard' id={props.i}>
                <h2>{props.tipo}</h2>
                <div className='listCard'>
                    {listado}
                </div>     
            </section>)
}

const ListGroup = (props) => {
    const listados = ['Curso online','Certificaciones','Viajes'];
    return listados.map((e,i) => <ListCard tipo={e} id={i}></ListCard>)
}

const News = (props) => {
    return  (<section className='portada'>
            </section>)
}

const Main = (props) => {
    return (<main>
                <News></News>
                <ListGroup></ListGroup>
            </main>)
}

const Navbar = (props) => {
    return (<nav className='navbar'>
                <ul>
                    <li><a href="#1">Inicio</a></li>
                    <li><a href="#2">Sobre nosotros</a></li>
                    <li><a href="#3">Contacto</a></li>
                </ul>
            </nav>)
}

const Header = (props) => {
    return(<header>
                <Navbar></Navbar>
            </header>)
}

const App = (props) => {
    return(
        <div className='root_2'>
            <Header></Header>
            <Main></Main>
        </div>
    )
}


ReactDOM.render(<Main></Main>,document.getElementById('root'))
